function(){
    var cid = "{{Container ID}}";
    var gtm_objects = [];    
    var gtm_counter = 0;
    var result = '';    
    for (var i in window.google_tag_manager) 
    {
        if (typeof(google_tag_manager[i]) == "object" && i.match(/^GTM-/)) {
            gtm_objects.push({'accountId': i});
        }
        if (typeof(google_tag_manager[i]) == "object" && !i.match(/^GTM-/)) {
            gtm_objects[gtm_counter].dataLayer = i;
            gtm_counter++;
        }
    }
    for (var i in gtm_objects)
        if (gtm_objects[i].accountId == cid)
            result = gtm_objects[i].dataLayer;

    if (result.length == 0)
        result = "dataLayer";

    return result;
}

function() {

       function isEmpty(object) { for(var i in object) { return false; } return true; }

	var clUrl = {{Click URL}};
        /*console.log (clUrl);*/
	var sUrl = {{Page URL}};
        if('undefined' != typeof({{Page URL fragment}})){
          sUrl = sUrl + "#"+{{Page URL fragment}};
        } 
	var host = {{Page Hostname}};
        /*console.log (host);*/        
	var jsResult = {};
	var linkTracker = {};
	linkTracker.trackDownload = true;
	linkTracker.trackDownloadExtensions = "7z|aac|arc|arj|asf|asx|avi|bin|csv|doc|docx|exe|"
					     +"flv|gif|gz|gzip|hqx|jar|jpe?g|js|mp(2|3|4|e?g)|mov(ie)?|msi|msp|pdf|phps|png|ppt|qtm?|"
					     +"ra(m|r)?|sea|sit|tar|tgz|torrent|txt|wav|wma|wmv|wpd|xls|xlsx|xml|z|zip";
	linkTracker.trackMailto = true;
	linkTracker.trackOutbound = true;

	var isInternal = new RegExp("^(https?):\/\/(" + host +").*", "i");
	var isDownload = new RegExp(".+\.(" + linkTracker.trackDownloadExtensions + ")$", "i");
	var isMailto = new RegExp("^(mailto:).+@.+\..+", "i");
	var isJs = new RegExp("^javascript:", "i");

	if (isInternal.test(clUrl)) {
		if (linkTracker.trackDownload && isDownload.test(clUrl)) {
			jsResult.eventCategory = "fileDownload";
			jsResult.eventAction = clUrl;
			jsResult.eventLabel = sUrl;
			jsResult.eventNonInteraction = false;
		}
	}
	else if (linkTracker.trackMailto && isMailto.test(clUrl)) {
			jsResult.eventCategory = "mailtoLinkClick";
			jsResult.eventAction = clUrl.substring(7);
			jsResult.eventLabel = sUrl;
			jsResult.eventNonInteraction = false;
	}
	else if (linkTracker.trackOutbound && !isInternal.test(clUrl) && !isJs.test(clUrl)) {
			jsResult.eventCategory = "outboundLinkClick";
			jsResult.eventAction = clUrl;
			jsResult.eventLabel = sUrl;
			jsResult.eventNonInteraction = false;
	}

    /*console.log(isEmpty(jsResult));*/
    if (isEmpty(jsResult)) { return false };

    return jsResult;
}

